import React from 'react';
import Footer from '../component/Footer';
import Header from '../component/Header';
import Cart from '../component/Cart/Cart'


const CartPage = (props) => {
    return (
        <>
            <Header />
            <Cart />
            <Footer />
        </>
    )

}

export default CartPage;
